void matprint(char **a,int m,int n)
{
    int i,j;
    for(i=0;i<m;i++)
    {
        for(j=0;j<n;j++)
        {
            printf("%c",a[i][j]);
        }
        printf("\n");
    }
}

void print_array(char **a,int m,int n)
{
    int x,y;


    for(x=0;x<m;x++)
    {
        for(y=0;y<n;y++)
        {
            printf("%c",a[x][y]);
        }
        printf("\n");
    }
}

