int main(void)
{
    int t;
    scanf("%d", &t);
    int curcase = 0;
    while (curcase != t)
    {
        int d, n;
	scanf("%d %d", &d, &n);
	double maxtime = 0;
	for (int i = 0; i < n; i++)
	{
	    int dist, speed;
	    scanf("%d %d", &dist, &speed);
	    double time = (d - dist) / (double)speed;
	    if (time > maxtime)
	    {
	        maxtime = time;
	    }
	}
	printf("Case #%d: %lf\n", curcase + 1, d / maxtime);
	curcase++;
    }
    return 0;
}

int main() {
    int t;
    scanf("%d", &t);

    for (int i = 0; i < t; i++) {
        int d, n;
        scanf("%d %d", &d, &n);

        float min = 0.0;
        for (int j = 0; j < n; j++) {
            int k, s;
            scanf("%d %d", &k, &s);

            float v = (float)d / (d - k) * s;
            if (j == 0) {
                min = v;
            } else {
                min = minF(min, v);
            }
        }
        printf("Case #%d: %f\n", i + 1, min);
    }
    return 0;
}

