void strreverse(char* src, long num) {
    long i;
    char* mod = malloc(num);

    for (i = 0; i < num; i++) {
        mod[i] = src[num - i - 1];
    }

    for (i = 0; i < num; i++) {
        src[i] = mod[i];
    }

    free(mod);
}

void panflip(char* src, long num) {
    long i;
    for (i = 0; i < num; i++) {
        if (src[i] == '+') {
            src[i] = '-';
        }
        else {
            src[i] = '+';
        }
    }

    strreverse(src, num);
}

long ishappy(char* src) {
    long i;
    for (i = 0; i < strlen(src); i++) {
        if (src[i] != '+') {
            return 0;
        }
    }
    return 1;
}

long firstsadindex(char* src) {

    if (ishappy(src)) {
        return -1;
    }

    long i;
    for (i = 0; i < strlen(src); i++) {
        if (src[i] == '-') {
            return i;
        }
    }
    return i;
}

long long int rev(long long int n)
{
	long long int num=0;
	while(n>0)
	{
		num=(num*10)+n%10;
		n=n/10;
	}
	return num;
}

long reverse(long n) {
  long r = 0;
  while (n > 0) {
    r = r * 10 + n % 10;
    n /= 10;
  }
  return r;
}

int leng(long long rnum)
{
	int x=0;
		while(rnum)
		{
         x++;
         rnum=rnum/10;
		 }
    return x;
}

void mark_digits(char *mark, int nr)
{
    while (nr > 0) {
        mark[nr % 10] = 1;
        nr = nr / 10;
    }
}

long long int ton(char* buf){
	long long int s = 0;
	while(*buf != '\0'){
		s = s*10 + *buf - '0';
		buf++;
	}
	return s;
}

ll rev(ll x)
{
	ll y = 0;
	while(x)
	{
		y = 10 * y + x % 10;
		x /= 10;
	}
	return y;
}

int digs(ll x)
{
	int cnt = 0;
	while(x)
	{
		x /= 10;
		cnt++;
	}
	return cnt;
}

int max(int* P, int len)
{
    int max = 0;
    int i;
    for (i = 0; i < len; i++) {
        max = max<P[i] ? P[i] : max;
    }

    return max;
}

int count(char *word, char c) {
  int num = 0;

  while (*word) {
    if (*word == c) {
      num++;
    }

    word++;
  }

  return num;
}

int len(char* buf){
	int l = 0;
	while(*buf++ != '\0') l++;
	return l;
}

ubig getsubsetindex( ubig K, ubig C, ubig* sublist, int num ) {
    int i;
    ubig result = 0;
    for (i = 0; i < num; i++) {
        result += sublist[i] * bpow(K, C - i - 1);
    }
    return result;
}

void dig(int n, int *a)
{
	while(n)
	{
		int temp = n%10;
		a[temp] = 1;
		n/=10;
	}
}

long long score(long long tim){
int c=0;
long long anstmp=0;
if (tim==0) return 0;
for(c=0;c<B;c++) {
anstmp+=(tim-1)/foo[c]+1;
}
return anstmp;
}

long interpret(int *num, int len, int base){
	int i;
	long baseholder = 1, ret = 0;
	for(i=0;i<len;i++){
		ret += baseholder * (num[len - i - 1]);
		baseholder *= base;
	}
	return ret;
}

