int cutmax(int* P, int len)
{
    int max = 0, maxi;
    int i;
    for (i = 0; i < len; i++) {
        if (max<P[i]) {
            max = P[i];
            maxi = i;
        }
    }

    P[maxi] = (P[maxi]+1)/2;

    return max;
}

