int matches(int nr, char *m, int len)
{
    int i;
    for (i = 0; i < len; ++i) {
        int d = nr % 10;
        nr = nr / 10;
        if (m[len - i - 1] == '?')
            continue;
        if (m[len - i - 1] != '0' + d)
            return 0;
    }
    return 1;
}

int countEmptyDiags(unsigned int *M, int r, int c, int R,int C){
	int num = 0;
	if(r >= c){
		int _r = r - c;
		int _c = 0;
		while(_r < R && _c < C){
			if((M[_r*C+_c] & 0xf0) == 0){
				num++;
			}
			_r++;
			_c++;
		}
	}else{
		int _r = 0;
		int _c = c-r;
		while(_r < R && _c < C){
			if((M[_r*C+_c] & 0xf0) == 0){
				num++;
			}	
			_r++;
			_c++;
		}
	}
	if(r+c < C){
		int _r = 0;
		int _c = c+r;
		while(_c >= 0 && _r < R){
			if((M[_r*C+_c] & 0xf0) == 0){
				num++;
			}	
			_r++;
			_c--;
		}
	}else{
		int _r = r - (C-c);
		int _c = C-1;
		while(_c >= 0 && _r < R){
			if((M[_r*C+_c] & 0xf0) == 0){
				num++;
			}
			_r++;
			_c--;
		}
	}
	return num;
}

void fillDiags(unsigned int *M,int r,int c, int R, int C,unsigned int val){
	// fill up SE diag
	if(r >= c){
		int _r = r - c;
		int _c = 0;
		while(_r < R && _c < C){
			M[_r*C + _c] |= val;
			_r++;
			_c++;
		}
	}else{
		int _r = 0;
		int _c = c-r;
		while(_r < R && _c < C){
			M[_r*C + _c] |= val;
			_r++;
			_c++;
		}
	}
	if(r+c < C){
		int _r = 0;
		int _c = c+r;
		while(_c >= 0 && _r < R){
			M[_r*C + _c] |= val;
			_r++;
			_c--;
		}
	}else{
		int _r = r - (C-c);
		int _c = C-1;
		while(_c >= 0 && _r < R){
			M[_r*C + _c] |= val;
			_r++;
			_c--;
		}
	}
}

F0(r,N)F0(c,N){
	// check if we put down either 'X' or '+'
	if(G[r*N+c] & (1<<6) || G[r*N+c] & (1<<2)){
		numOfMod++;
	}
	int X = G[r*N+c] & (1<<0 | 1<<2);
	int P = G[r*N+c] & (1<<4 | 1<<6);
	if(X && P)points+=2;
	else if(X)points++;
	else if(P)points++;

}

F0(r,N)F0(c,N){
	// check if we put down either 'X' or '+'
	if(G[r*N+c] & (1<<6) || G[r*N+c] & (1<<2)){
		int X = G[r*N+c] & (1<<0 | 1<<2);
		int P = G[r*N+c] & (1<<4 | 1<<6);
		if(X && P)printf("o %d %d\n",r+1,c+1);
		else if(X)printf("x %d %d\n",r+1,c+1);
		else if(P)printf("+ %d %d\n",r+1,c+1);
		else{
			fprintf(stderr,"Not supposed to reach this\n");
			return 1;
		}
	}
}

void try2(int index) {
	if(index==N) {
		compare();
		return;
	}
	if(Q[index]=='?') {
		int i;
		for(i=0; i<10; i++) {
			Q[index] = i + '0';
			try2(index+1);
		}
		Q[index] = '?';
	} else try2(index+1);
}

void try(int index) {
	if(index==N) {
		try2(0);
		return;
	}
	if(P[index]=='?') {
		int i;
		for(i=0; i<10; i++) {
			P[index] = i + '0';
			try(index+1);
		}
		P[index] = '?';
	} else try(index+1);
}

