void fun(char **arr,int m,int n)
{
    int x,y,f;


    for(x=0;x<m;x++)
    {        f = 1;
        for(y=0;y<n;y++)
        {
            if(arr[x][y]!='?')
            {
                f = 0;
                break;
            }
        }
        if(f)
        {
            for(y=0;y<n;y++)
            {
                arr[x][y]='a';
            }
        }
        else
        {
            for(y=1;y<n;y++)
            {
                if(arr[x][y-1]!='?' && arr[x][y]=='?')
                {
                    arr[x][y] = arr[x][y-1];
                }
            }
            if(arr[x][0]=='?')
            {
                for(y=0;y0;y--)
                {
                    arr[x][y-1]=arr[x][y];
                }
            }
        }
    }


    if(arr[0][0]=='a')
    {
        for(x=0;x0;x--)
        {
            for(y=0;y<n;y++)
            {
                arr[x-1][y]=arr[x][y];
            }
        }
    }


    for(x=1;x<m;x++)
    {
        if(arr[x][0]=='a')
        {
            for(y=0;y<n;y++)
            {
                arr[x][y]=arr[x-1][y];
            }
        }
    }


	print_array(arr,m,n);


}

