                a[i][j]='a';
            }
        }
        else
        {
            for(j=1;j<n;j++)
            {
                if(a[i][j-1]!='?' && a[i][j]=='?')
                {
                    a[i][j] = a[i][j-1];
                }
            }
            if(a[i][0]=='?')
            {
                for(j=0;j0;j--)
                {
                    a[i][j-1]=a[i][j];
                }
            }
        }
    }

    if(a[0][0]=='a')
