int cmp(const void *a, const void *b)
{
	double *da = (double*)a;
	double *db = (double*)b;

	if(*da == *db) return 0;
	return *da > *db ? -1 : 1;
}

int compare(const void *a,const void *b){
  double *A = (double*)a;
  double *B = (double*)b;
  if(*B<*A)
    return 1;
  if(*A==*B)
    return 0;
  return -1;
}

