int
dfs(int u, int rn)
{
    int v;
    for (v = 0; v < rn; ++v)
        if (rela[u][v] && !visited[v]) {
            visited[v] = 1;
            if (pairy[v] == -1 || dfs(pairy[v], rn)) {
                pairx[u] = v;
                pairy[v] = u;
                return 1;
            }
        }
    return 0;
}

int dfs(int a[MAXN][MAXN],int m1[],int m2[],int n,int k,int b[]) {
	int i;
	b[k]=1;
	for(i=0;i<n;i++) if (a[k][i]) {
		if (m2[i]<0 || !b[m2[i]] && dfs(a,m1,m2,n,m2[i],b)) {
			m1[k]=i,m2[i]=k;
			return 1;
		}
	}
	return 0;
}

int getval(int *array, int size)
{
	int i=0, num=0;
	for (i=0;i<size;i++)
		num+= array[i]*pow(10,i);
	return num;
}

long int powr(long int a, long int b)
{
	long int i,ans=1;
	for(i=0;i<b;i++)
	ans=ans*a;
	return ans;
}

