void next_permutation(int pos, int n) {
	int i;
	if (pos == n) {
		check(n);
		return;
	}
	for (i = 0; i < n; ++i) {
		if (!used[i]) {
			perm[pos] = i;
			used[i] = 1;
			next_permutation(pos + 1, n);
			used[i] = 0;
		}
	}
}

void go(int pos, int max) {
  int i;
  if (pos>2 && perm[pos-3] != bff[perm[pos-2]] && perm[pos-1] != bff[perm[pos-2]])
    return;
  if (ok) return;
  if (pos==max) {
    for (i=0; i<max; i++)
      if (perm[(i-1+max)%max] != bff[perm[i]] && perm[(i+1)%max] != bff[perm[i]])
	return;
    ok=1;
  } else {
    for (i=1; i<=n; i++)
      if (!used[i]) {
	perm[pos] = i;
	used[i] = 1;
	go(pos+1, max);
	used[i] = 0;
      }
  }
}

